import styled from 'styled-components';

export const Container = styled.main`
  margin-top: 40px;
position: relative;
:hover {
        transition: 0.6s;
        color: #000000ff;;
        -webkit-transform: scale(1.2, 1.2);
          transform: scale(1.2, 1.2);
        }

`
